import React from "react";
import rmimg from "./rmimg.png"
import Grid from "@material-ui/core/Grid";

const RmImg = () => {
    return (
        <Grid container item>
            <img src={rmimg} alt="Styling"></img>
        </Grid>
    )
}

export default RmImg;
